import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Goals = () => {
  const [goals, setGoals] = useState([]);
  const [form, setForm] = useState({
    name: '',
    targetAmount: '',
    savedAmount: '',
    description: '',
    deadline: '',
  });

  // Fetch Goals from Backend
  useEffect(() => {
    const fetchGoals = async () => {
      try {
        const response = await axios.get('/api/goals'); // Replace with your API endpoint
        setGoals(response.data);
      } catch (error) {
        console.error('Error fetching goals:', error);
      }
    };

    fetchGoals();
  }, []);

  // Handle Form Input Changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prevForm) => ({ ...prevForm, [name]: value }));
  };

  // Handle Form Submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/goals', form); // Replace with your API endpoint
      setGoals((prevGoals) => [...prevGoals, response.data]); // Add new goal to state
      setForm({
        name: '',
        targetAmount: '',
        savedAmount: '',
        description: '',
        deadline: '',
      }); // Reset form
    } catch (error) {
      console.error('Error creating goal:', error);
    }
  };

  return (
    <div>
      <h1>Goals</h1>

      {/* Display Goals */}
      <ul>
        {goals.map((goal) => (
          <li key={goal._id}>
            <h2>{goal.name}</h2>
            <p><strong>Target Amount:</strong> ${goal.targetAmount}</p>
            <p><strong>Saved Amount:</strong> ${goal.savedAmount}</p>
            <p><strong>Description:</strong> {goal.description || 'No description'}</p>
            <p><strong>Deadline:</strong> {new Date(goal.deadline).toLocaleDateString()}</p>
          </li>
        ))}
      </ul>

      {/* Create New Goal Form */}
      <form onSubmit={handleSubmit}>
        <h2>Create New Goal</h2>
        <div>
          <label>
            Name:
            <input
              type="text"
              name="name"
              value={form.name}
              onChange={handleChange}
              required
            />
          </label>
        </div>
        <div>
          <label>
            Target Amount:
            <input
              type="number"
              name="targetAmount"
              value={form.targetAmount}
              onChange={handleChange}
              required
            />
          </label>
        </div>
        <div>
          <label>
            Saved Amount:
            <input
              type="number"
              name="savedAmount"
              value={form.savedAmount}
              onChange={handleChange}
            />
          </label>
        </div>
        <div>
          <label>
            Description:
            <textarea
              name="description"
              value={form.description}
              onChange={handleChange}
            ></textarea>
          </label>
        </div>
        <div>
          <label>
            Deadline:
            <input
              type="date"
              name="deadline"
              value={form.deadline}
              onChange={handleChange}
              required
            />
          </label>
        </div>
        <button type="submit">Create Goal</button>
      </form>
    </div>
  );
};

export default Goals;
